import React, { useState } from 'react';

function App() {
  const [currentPage, setCurrentPage] = useState('home');

  const renderPage = () => {
    if (currentPage === 'about') {
      return <About />;
    }
    return <Home />;
  };

  return (
    <div>
      <ul>
        <li className="navbar-item">
          <h5 onClick={() => setCurrentPage('home')}>Home</h5>
        </li>
        <li className="navbar-item">
          <h5 onClick={() => setCurrentPage('about')}>About</h5>
        </li>
      </ul>
      {renderPage()}
    </div>
  );
}

function Home() {
  return <div>Home Page Content</div>;
}

function About() {
  return <div>About Page Content</div>;
}

export default App;
